INSERT INTO `Review` VALUES (1,'2017-04-26 04:21:52','This place sucks. Bad desks, tight seating, so run down. :(','Aditya','314','Altgeld Hall'),(4,'2017-04-26 04:41:28','There are a lot of seats in this classroom, and the spacing between rows is sufficient so that you don\'t need to crawl over others to sit down. \r\n\r\nThere are two projectors in the room, so you don\'t need to worry about being in a bad seat.','Aditya','106B8','Engineering Hall'),(5,'2017-04-26 04:42:19','One of the nicest lecture halls on campus.  Super comfy and modern.','Andrew','1404','Siebel Center for Comp Sci'),(5,'2017-04-26 04:42:21','The seating is nice, plenty of seats, multiple screens, and great electronics.','Rajesh Patel','0216','Siebel Center for Comp Sci'),(4,'2017-04-26 04:43:48','Lots of computers that almost always work.','Rajesh Patel','0218','Siebel Center for Comp Sci'),(4,'2017-04-26 04:43:57','A standard classroom in the English Building. The desks are normal classroom seats. Nothing to write about, but not terrible.','Aditya','304','English Building'),(5,'2017-04-26 04:44:41','Older building, but still a fairly nice lecture hall wth comfy seats and pretty good legroom.  I like having class there.','Andrew','1320','Digital Computer Laboratory'),(5,'2017-04-26 04:44:48','I like this classroom a lot. It\'s new and really nice.','Rajesh Patel','1404','Siebel Center for Comp Sci'),(3,'2017-04-26 04:46:21','Small desks, lack of legroom, and it can get crowded quickly.','Rajesh Patel','AUD','Foellinger Auditorium'),(1,'2017-04-26 04:46:25','This is the worst lecture hall on campus.  Desks falling apart, super uncomfortable, no air conditioning in the whole building either!','Andrew','314','Altgeld Hall'),(3,'2017-04-26 04:48:46','worst, horrible, terrible room','Rajesh Patel','103','Transportation Building'),(3,'2017-04-26 04:49:29','No AC which is huge problem.  Desks not very comfy and old also.  Not too bad of a room though but hard to find just like every building in Altgeld.','Andrew','347','Altgeld Hall'),(4,'2017-04-26 04:50:29','I like this wonderful room a lot.','Rajesh Patel','THEAT','Lincoln Hall'),(3,'2017-04-26 04:51:24','Decent lecture hall, although not a lot of room, and if you have a bigger stomach the desk will push into your stomach which is not fun on exam days.','Andrew','150','Animal Sciences Laboratory'),(2,'2017-04-26 04:51:40','The classroom has steep seating, so be careful when entering the classroom. The desks aren\'t the best, so come early to lecture!','Aditya','100','Noyes Laboratory'),(5,'2017-04-26 04:52:21','Nice medium-sized class that is new and fresh.','Rajesh Patel','3063','Business Instructional Fac'),(1,'2017-04-26 04:52:58','Horrific lecture hall!  Less than no leg room, tiny desks, and kind steep as well.  Would not recommend.','Andrew','100','Noyes Laboratory'),(4,'2017-04-26 04:54:09','This room has obviously been designed for the 21st century in mind. The desks are well-made and still in good quality, and there is plenty of space between the rows in the room.\r\n\r\nWhile it\'s no Siebel 1404, it\'s still a good lecture hall!','Aditya','1320','Digital Computer Laboratory'),(5,'2017-04-26 04:54:09','Fantastic, modern classroom with plenty of space. Weird support beam in one place.','Peter Simpson','0216','Siebel Center for Comp Sci'),(4,'2017-04-26 04:54:27','In an older building but not a bad lecture hall at all.  Although if you are sitting in the back and they are writing on the board it can be very hard to see in such a long lecture hall.','Andrew','141','Wohlers Hall'),(5,'2017-04-26 04:55:18','This is a large class with lots of seats and good wifi.','Peter Simpson','1404','Siebel Center for Comp Sci'),(3,'2017-04-26 04:55:34','Pretty decent room. Unfortunately, there isn\'t much space between seats in the rows, so you have to crawl over each other to sit down if you are late. Small desks too.','Aditya','2','Education Building'),(1,'2017-04-26 04:55:40','Felt like I was in a dungeon.  Water leaking in from the tiles.  Absolutely terrible!','Andrew','69','English Building'),(5,'2017-04-26 04:57:07','Nice modern classroom!','Andrew','0216','Siebel Center for Comp Sci'),(2,'2017-04-26 04:57:08','It\'s a tight classroom; there are so many seats in this room, so the rows are very close together. Don\'t come here late and expect to find a seat. It\'s also hard to find if you don\'t know your way in the labyrinthine FLB.','Aditya','G32','Foreign Languages Building'),(4,'2017-04-26 04:57:11','This lecture hall has a lot of seats, but they\'re all small.','Peter Simpson','AUD','Foellinger Auditorium'),(4,'2017-04-26 04:58:25','This classroom makes me feel happy when I have to wake up in the morning.','Peter Simpson','3063','Business Instructional Fac'),(2,'2017-04-26 04:58:35','Scary steep.  Like I\'m always afraid I\'m going to fall to my death there.','Andrew','141','Loomis Laboratory'),(3,'2017-04-26 04:58:51','This is a glorified storage closet. I know we have budget cuts, but why do you have to put students in a tiny room? At least there is a computer.','Aditya','1112','Foreign Languages Building'),(3,'2017-04-26 04:59:25','This classroom is not a nice place to have class.','Peter Simpson','123','David Kinley Hall'),(5,'2017-04-26 04:59:33','Super nice computer lab.  Comfy and has up to date tech.','Andrew','0218','Siebel Center for Comp Sci'),(1,'2017-04-26 05:00:29','Ah... Loomis 141. The home of many failed Physics exams. If the exams don\'t kill you, the tight, steep seating and aged/not properly working desks will.','Aditya','141','Loomis Laboratory'),(5,'2017-04-26 05:00:47','Super nice computer lab, nice quiet space to work.','Andrew','0222','Siebel Center for Comp Sci'),(5,'2017-04-26 05:01:33','This classroom is the best place on campus. It makes me feel good about myself.','Peter Simpson','103','Transportation Building'),(3,'2017-04-26 05:03:01','Average lecture hall, although not a lot of leg room','Andrew','114','David Kinley Hall'),(4,'2017-04-26 05:03:35','This classroom melts my heart and I always feel lucky sitting here.','Peter Simpson','THEAT','Lincoln Hall'),(5,'2017-04-26 05:03:47','This room is my favorite classroom on campus! The modern lecture hall has power outlets in the seats, so I don\'t have to worry about my computer dying. Also, there is a lot of space between seats so I can feel less worried about hitting someone when leaving class.\r\n\r\nThe wifi here is also excellent!','Aditya','1404','Siebel Center for Comp Sci'),(1,'2017-04-26 05:04:22','Older room but in nice condition.','Andrew','THEAT','Lincoln Hall'),(5,'2017-04-26 05:05:42','Omg! I luv this class. It\'s the best one I\'ve ever seen. Wifi\'s great, loud speakers, and very nice seats!!','Janki Chen','1404','Siebel Center for Comp Sci'),(3,'2017-04-26 05:05:49','Large lecture hall but not a lot of leg room.  Although can get kind of noisy with so many people.','Andrew','AUD','Foellinger Auditorium'),(5,'2017-04-26 05:05:58','I have often enjoyed classes here. The lecture hall is clean, and the desks have a lot of room to spread out during exams. If only the rest of campus was like this. :(','Maarja-Liis Ilus','1404','Siebel Center for Comp Sci'),(3,'2017-04-26 05:07:15','Kind of old but not bad.  Ok amount of leg room.','Andrew','100','Gregory Hall'),(4,'2017-04-26 05:08:10','I have badm 320 lol here and it\'s the bestest! but there ain\'t space for my legs','Janki Chen','AUD','Foellinger Auditorium'),(5,'2017-04-26 05:08:53','Modern classroom just like the rest of the building!','Andrew','1131','Siebel Center for Comp Sci'),(4,'2017-04-26 05:09:12','I always get lost when I try finding this classroom, even if it\'s most of the way through the semester. However, the room itself is pretty decent, with lots of room on desks, and with rolling chairs too!','Maarja-Liis Ilus','1105','Siebel Center for Comp Sci'),(4,'2017-04-26 05:09:47','I had a class here last semester and it was nice to have space and multiple monitors.','Janki Chen','3063','Business Instructional Fac'),(5,'2017-04-26 05:10:40','Nice hip and modern lecture hall!','Sarah','1404','Siebel Center for Comp Sci'),(3,'2017-04-26 05:10:58','Eww. this class smelled like mildew and mold. I think I got a stroke. lol','Janki Chen','103','Transportation Building'),(5,'2017-04-26 05:11:11','Great wonderful amazing classroom! :)','Aditya','201','505 E Green'),(5,'2017-04-26 05:11:38','Small and homey lecture hall but just as nice as the rest of the building.','Sarah','0216','Siebel Center for Comp Sci'),(1,'2017-04-26 05:12:17','absolute worst place on planet earth','Janki Chen','100','Noyes Laboratory'),(1,'2017-04-26 05:13:57','This room is like a prison. The Armory generally is terrible. :( If only they had cats. TÃ©st','Aditya','100','Armory'),(1,'2017-04-26 05:14:35','Super steep and very uncomfortable and cramped.  Terrible, terrible, terrible, terrible lecture hall.  DO NOT HAVE CLASS HERE!','Sarah','100','Noyes Laboratory'),(1,'2017-04-26 05:16:50','Worst lecture hall.  Terrible place to be.  Falling apart, lack of desks, and terribly uncomfortable.','Sarah','314','Altgeld Hall'),(2,'2017-04-26 05:18:12','Interesting building, but there is no AC.  How do we have buildings with no AC!','Sarah','89','Allen Residence Hall'),(5,'2017-04-26 05:18:13','Cats make me go crazy, so its nice to have a room that makes me feel sane.','Shannon Newman','0216','Siebel Center for Comp Sci'),(1,'2017-04-26 05:18:42','Ugly terrible worst horrific weird disappointing bad sad depressing room.','Siddhartha','100','Noyes Laboratory'),(5,'2017-04-26 05:19:26','I like business class because I want to get in the business of cats.','Shannon Newman','3063','Business Instructional Fac'),(4,'2017-04-26 05:20:13','Good lecture hall and pretty comfortable.  Looks old on outside, nice on inside though.','Sarah','1320','Digital Computer Laboratory'),(3,'2017-04-26 05:21:24','Had a final here.  Odd building but not too bad.','Sarah','149','National Soybean Res Ctr'),(1,'2017-04-26 05:22:30','Thoughts: crying, death, terrifying, nightmares, screams','Shannon Newman','100','Noyes Laboratory'),(2,'2017-04-26 05:22:57','Very uncomfortable, there\'s usually no seating when I come in for class, especially on exam days. ','Mrudula Vysyaraju','426','Mumford Hall'),(3,'2017-04-26 05:22:59','Large room which can be annoying especially when you have assigned seats for exams.','Sarah','AUD','Foellinger Auditorium'),(1,'2017-04-26 05:24:10','Old dull room in basement.  Hard to find and looks like you are in a place you shouldn\'t be.','Sarah','61','English Building'),(4,'2017-04-26 05:25:19','Room is pretty nice even though it\'s pretty old.','Sarah','THEAT','Lincoln Hall'),(4,'2017-04-26 05:25:25','Nice class with good air conditioning','Shannon Newman','103','Transportation Building'),(5,'2017-04-26 05:26:37','Nice new clean class','Shannon Newman','1404','Siebel Center for Comp Sci'),(4,'2017-04-26 05:27:11','Decent computer lab.  Comfy seats and good temp.','Sarah','G8A','Foreign Languages Building'),(2,'2017-04-26 05:28:37','Very hot in summer, not sure it\'s airconditioned.  Kind of cramped as well.','Sarah','G46','Foreign Languages Building'),(5,'2017-04-26 05:29:27','Glorious!','Siddhartha','67','Animal Sciences Laboratory'),(5,'2017-04-26 05:29:40','I observed some very nice equipment','Shawn Spencer','1404','Siebel Center for Comp Sci'),(1,'2017-04-26 05:29:48','Glorious Glorious Glorious Glorious Glorious Glorious Glorious Glorious Glorious Glorious Glorious Glorious room.','Siddhartha','67','Animal Sciences Laboratory'),(3,'2017-04-26 05:30:32','Decent classroom but is kind of cramped like most of these older buildings.','Sarah','317','Gregory Hall'),(3,'2017-04-26 05:32:47','Decent lecture hall but kind of cramped.  Able to see boards easily from all parts of room though.','Sarah','67','Animal Sciences Laboratory'),(5,'2017-04-26 05:32:58','I spied with my eyes an enjoyable learning environment','Shawn Spencer','0216','Siebel Center for Comp Sci'),(1,'2017-04-26 05:35:33','Terrible old lecture hall that is falling apart.  Most seats don\'t even have a desk.','Nathan','314','Altgeld Hall'),(5,'2017-04-26 05:36:44','I detected just a few electric outlets, but otherwise a nice classroom','Shawn Spencer','3063','Business Instructional Fac'),(3,'2017-04-26 05:36:53','Kind of hidden in the basement of an unairconditioned dorm. Ok I guess.','Nathan','89','Allen Residence Hall'),(5,'2017-04-26 05:38:16','Super nice and temperature controlled.  Always love having lectures here!','Nathan','1404','Siebel Center for Comp Sci'),(4,'2017-04-26 05:38:24','I negotiated that the classroom has very little legroom','Shawn Spencer','AUD','Foellinger Auditorium'),(4,'2017-04-26 05:41:07','Nice lecture hall.','Nathan','1320','Digital Computer Laboratory'),(3,'2017-04-26 05:41:32','Room is nice, doesn\'t usually get competitive for seats. Seats are not conformable for long lectures though. ','Maarja JÃ¤irvi','1310','Digital Computer Laboratory'),(4,'2017-04-26 05:43:43','Nice lecture hall. Can get noisy in the back in large classes. Large class can have issues with not enough seat capacity, get here early for those classes. ','Maarja JÃ¤irvi','1320','Digital Computer Laboratory'),(2,'2017-04-26 05:46:03','Terrible desks, it\'s easier to give up on them and get a lap desk for exams. This is not fun really in the morning, or anytime,  really. ','Maarja JÃ¤irvi','314','Altgeld Hall'),(5,'2017-04-26 05:47:39','Nice chairs, good view of screen (even behind pillars, there\'s a TV to ensure that people can see slides)  ','Maarja JÃ¤irvi','1109','Siebel Center for Comp Sci'),(1,'2017-04-26 05:54:59','Test.','Siddhartha','134','Astronomy Building'),(5,'2017-04-26 06:22:36','I really love this classroom!','Demo','1404','Siebel Center for Comp Sci');
